import Foundation

@available(iOS 11.3, *)
@objc(BabylonModule)
final class BabylonModule : NSObject, RCTBridgeModule {

    static func moduleName() -> String! {
        "BabylonModule"
    }
    
    static func requiresMainQueueSetup() -> Bool {
        return true
    }
    
    @objc func initialize(_ resolve: RCTPromiseResolveBlock, reject: RCTPromiseRejectBlock) -> Void
    {
        resolve(false)
    }
    
    @objc func whenInitialized(_ resolve: RCTPromiseResolveBlock, reject: RCTPromiseRejectBlock) -> Void
    {
        resolve(false)
    }
}
